import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

function UserProfileMatches() {
  const [matches, setMatches] = useState([]);
  const [error, setError] = useState(null);
  const { id } = useParams();  // Extract `id` from the URL parameters

  useEffect(() => {
    if (id) {
      axios.get(`http://localhost:8000/api/matchmaking/${id}/`)
        .then(response => {
          setMatches(response.data);
        })
        .catch(error => {
          setError('Error fetching matches');
          console.error('Error fetching matches:', error);
        });
    } else {
      setError('Invalid user ID');
    }
  }, [id]);

  return (
    <div>
      <h1>Matches for User {id}</h1>
      {error && <p>{error}</p>}
      <ul>
        {matches.length > 0 ? (
          matches.map(profile => (
            <li key={profile.user}>
              {profile.user} - {profile.location}
            </li>
          ))
        ) : (
          <p>No matches found</p>
        )}
      </ul>
    </div>
  );
}

export default UserProfileMatches;
